import React from 'react';
import DatePicker from "react-datepicker";
import "react-datepicker/dist/react-datepicker.css";

class myTimePickerComponent extends React.Component {

    constructor(props) {
        super(props);
        this.state = {
        };
    }

    componentDidMount() {
    }

    render() {
        return 
        <DatePicker
            selected={this.state.monday.myDateFrom}
            onChange={time => this.handleChange(time, 'mondayFrom')}
            showTimeSelect
            showTimeSelectOnly
            timeIntervals={this.state.periodLenght}
            timeCaption="Time"
            disabledKeyboardNavigation
            timeFormat="HH:mm"
            dateFormat="HH:mm"
        />
    }
}

export default myTimePickerComponent;
